    </SearchButtonStyle> */}
  </HeaderWrapper>
);

const HeaderWrapper = styled.header`
  display: grid;
  grid-template-columns: auto 80px;
  grid-area: header;
`;

const TextContainer = styled.div`
  padding: 10px 16px;
  display: flex;
  flex-direction: column;
  justify-content: space-between;
  height: 100%;
  h1 {
    font-size: 32px;
    color: #464646;
    font-weight: 700;
  }
  h2 {
    font-size: 16px;
    color: #686868;
  }
`;

export default Header;
